{"filter":false,"title":"tables.js","tooltip":"/Frontend/Frontoffice/startbootstrap-scrolling-nav-gh-pages/vendor/bootstrap/js/tables.js","undoManager":{"mark":0,"position":0,"stack":[[{"start":{"row":0,"column":0},"end":{"row":33,"column":1},"action":"insert","lines":["function sortTable() {","  var table, rows, switching, i, x, y, shouldSwitch;","  table = document.getElementById(\"myTable\");","  switching = true;","  /*Make a loop that will continue until","  no switching has been done:*/","  while (switching) {","    //start by saying: no switching is done:","    switching = false;","    rows = table.rows;","    /*Loop through all table rows (except the","    first, which contains table headers):*/","    for (i = 1; i < (rows.length - 1); i++) {","      //start by saying there should be no switching:","      shouldSwitch = false;","      /*Get the two elements you want to compare,","      one from current row and one from the next:*/","      x = rows[i].getElementsByTagName(\"TD\")[0];","      y = rows[i + 1].getElementsByTagName(\"TD\")[0];","      //check if the two rows should switch place:","      if (Number(x.innerHTML) > Number(y.innerHTML)) {","        //if so, mark as a switch and break the loop:","        shouldSwitch = true;","        break;","      }","    }","    if (shouldSwitch) {","      /*If a switch has been marked, make the switch","      and mark that a switch has been done:*/","      rows[i].parentNode.insertBefore(rows[i + 1], rows[i]);","      switching = true;","    }","  }","}"],"id":1}]]},"ace":{"folds":[],"scrolltop":0,"scrollleft":0,"selection":{"start":{"row":33,"column":1},"end":{"row":33,"column":1},"isBackwards":false},"options":{"guessTabSize":true,"useWrapMode":false,"wrapToView":true},"firstLineState":{"row":15,"state":"comment1","mode":"ace/mode/javascript"}},"timestamp":1606674392670,"hash":"6b4580fdb27ebc56f32b2b684840fdfcbeb00e80"}